import { useState, useEffect } from "react";

export const Test = () => {
  useEffect(() => {
    const [test, setTest] = useState("initial");

    try {
      fetch("http://localhost:3000/api", {
        method: "GET",
      })
        .then((res) => console.log(res.json()))
        .then((data) => console.log(data.message));
    } catch (error) {
      console.log("error =>", error);
    }
  }, []);

  return <h1>Test</h1>;
};
